// src/components/EvaluationDetail.js
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import './EvaluationDetail.css';
import { ReactComponent as BackIcon } from '../assets/back-icon.svg';

function EvaluationDetail() {
  const { id } = useParams();
  const isCreateMode = !id;
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const [loading, setLoading] = useState(true);
  const [formData, setFormData] = useState({
    id: '',
    id_producto: '',
    id_usuario: '',
    id_tipo_evaluacion: '',
    fecha_evaluacion: new Date().toISOString().slice(0, 10),
    observaciones: ''
  });
  const [productos, setProductos] = useState([]);
  const [usuarios, setUsuarios] = useState([]);
  const [tiposEval, setTiposEval] = useState([]);

  useEffect(() => {
    const headers = { Authorization: `Bearer ${token}` };
    (async () => {
      try {
        console.log('‚è≥ Cargando datos...');
        const [prodRes, userRes, tipoRes] = await Promise.all([
          fetch('http://localhost:4000/api/productos', { headers }),
          fetch('http://localhost:4000/api/usuarios', { headers }),
          fetch('http://localhost:4000/api/tipo_evaluacion', { headers })
        ]);
        const [{ body: prods }, { body: usrs }, { body: tips }] =
          await Promise.all([prodRes.json(), userRes.json(), tipoRes.json()]);
        setProductos(prods);
        setUsuarios(usrs);
        setTiposEval(tips);
  
        if (isCreateMode) {
          // Restaurar valores por defecto
          setFormData({
            id: '',
            id_producto: '',
            id_usuario: '',
            id_tipo_evaluacion: '',
            fecha_evaluacion: new Date().toISOString().slice(0, 10),
            observaciones: ''
          });
        } else {
          console.log('üîç Modo lectura - ID recibido:', id);
          const evRes = await fetch(`http://localhost:4000/api/evaluaciones/${id}`, { headers });
          const evJson = await evRes.json();
          console.log('üìÑ Evaluaci√≥n recibida del backend:', evJson);
  
          if (!evJson.body) {
            console.warn('‚ö†Ô∏è No se encontr√≥ body en la respuesta:', evJson);
          }
  
          const d = evJson.body;
          setFormData({
            id: d.id.toString(),
            id_producto: d.id_producto?.toString() || '',
            id_usuario: d.id_usuario?.toString() || '',
            id_tipo_evaluacion: d.id_tipo_evaluacion?.toString() || '',
            fecha_evaluacion: d.fecha_evaluacion?.slice(0, 10) || '',
            observaciones: d.observaciones || ''
          });
        }
      } catch (err) {
        console.error('‚ùå Error al cargar datos:', err);
      } finally {
        setLoading(false);
      }
    })();
  }, [id, isCreateMode, token]);
  
  const handleGoBack = () => {
    navigate(isCreateMode ? '/dashboard' : '/evaluaciones');
  };

  const handleChange = (e) => {
    setFormData(prev => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch('http://localhost:4000/api/evaluaciones', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`
        },
        body: JSON.stringify({
          ...formData,
          id: isCreateMode ? 0 : formData.id
        })
      });
      if (!res.ok) throw new Error('Error al guardar evaluaci√≥n');
      navigate('/dashboard');
    } catch (err) {
      console.error(err);
    }
  };

  if (loading) {
    return <div className="evaluation-detail-container">Cargando...</div>;
  }

  const nombreProducto = productos.find(p => p.id.toString() === formData.id_producto)?.nombre || '‚Äî';
  const usr = usuarios.find(u => u.id.toString() === formData.id_usuario);
  const nombreUsuario = usr ? `${usr.nombre} ${usr.apellido}` : '‚Äî';
  const nombreTipo = tiposEval.find(t => t.id.toString() === formData.id_tipo_evaluacion)?.nombre_tipo_evaluacion || '‚Äî';

  return (
    <div className="evaluation-detail-container">
      <div className="evaluation-detail-card">
        <div className="detail-header">
          <button className="back-button" onClick={handleGoBack}>
            <BackIcon className="back-icon" />
            <span>Regresar</span>
          </button>
          <h2>{isCreateMode ? 'Nueva Evaluaci√≥n' : 'Detalle de Evaluaci√≥n'}</h2>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="detail-item">
            <label>ID Evaluaci√≥n:</label>
            <div className="detail-value">
              {isCreateMode ? 'Pendiente' : formData.id}
            </div>
          </div>

          <div className="detail-item">
            <label>Producto:</label>
            {isCreateMode ? (
              <select
                name="id_producto"
                value={formData.id_producto}
                onChange={handleChange}
                required
              >
                <option value="">Seleccione un producto</option>
                {productos.map(p => (
                  <option key={p.id} value={p.id}>{p.nombre}</option>
                ))}
              </select>
            ) : (
              <div className="detail-value">{nombreProducto}</div>
            )}
          </div>

          <div className="detail-item">
            <label>Evaluador:</label>
            {isCreateMode ? (
              <select
                name="id_usuario"
                value={formData.id_usuario}
                onChange={handleChange}
                required
              >
                <option value="">Seleccione un usuario</option>
                {usuarios.map(u => (
                  <option key={u.id} value={u.id}>{u.nombre} {u.apellido}</option>
                ))}
              </select>
            ) : (
              <div className="detail-value">{nombreUsuario}</div>
            )}
          </div>

          <div className="detail-item">
            <label>Tipo de Evaluaci√≥n:</label>
            {isCreateMode ? (
              <select
                name="id_tipo_evaluacion"
                value={formData.id_tipo_evaluacion}
                onChange={handleChange}
                required
              >
                <option value="">Seleccione un tipo</option>
                {tiposEval.map(t => (
                  <option key={t.id} value={t.id}>{t.nombre_tipo_evaluacion}</option>
                ))}
              </select>
            ) : (
              <div className="detail-value">{nombreTipo}</div>
            )}
          </div>

          <div className="detail-item">
            <label>Fecha:</label>
            <div className="detail-value">{formData.fecha_evaluacion}</div>
          </div>

          <div className="detail-item">
            <label>Observaciones:</label>
            {isCreateMode ? (
              <textarea
                name="observaciones"
                value={formData.observaciones}
                onChange={handleChange}
                placeholder="Agregar observaciones..."
              />
            ) : (
              <div className="detail-value">{formData.observaciones || '‚Äî'}</div>
            )}
          </div>

          {isCreateMode && (
            <div className="detail-actions">
              <button type="submit" className="save-button">
                Crear Evaluaci√≥n
              </button>
            </div>
          )}
        </form>
      </div>
    </div>
  );
}

export default EvaluationDetail;
